import React from "react";

const Learn_Bgsection = ({ car }) => {
  return (
    <section
      className="h-screen flex flex-col justify-end bg-cover bg-no-repeat shadowAround padding"
      style={{ backgroundImage: "url(" + car.cover + ")" }}
    >
      <div className="max-w-[500px]">
        <h3 className="title">{car.title}</h3>
        <p>{car.describe}</p>
      </div>
    </section>
  );
};

export default Learn_Bgsection;
